local strfind, m = string.find, 5
local Spam = function(msg)
	local a = 0
	for i = 1, m do
		for j=1, #L[i] do
			if strfind(msg, L[i][j]) then
				a = i>4 and a+3 or i>3 and a-1 or i>2 and a+1 or a+10
			end
		end
	end
	return a > 3
end

